import React from "react";
import PropertyCard from "../components/PropertyCard"; // Corrected import path for PropertyCard
import DefaultLayout from "../layouts/DefaultLayout";

const ViuLaNatura = () => {
  const property = {
    title: "PLANA DE CAL BOU",
    subtitle: "Fontaneda, Andorra",
    description:
      "Un antic assecador de tabac i ara la casa dels teus somnis.",
    images: [
      "https://placehold.co/600x400", // grande image à gauche
      "https://placehold.co/300x200", // mini image 1
      "https://placehold.co/300x200", // mini image 2
    ],
    link: "/lot-de-bien/cal-bou",
  };

  return (
    <DefaultLayout>
      <div style={{ backgroundColor: "#212226", padding: "40px 0" }}>
        <h1 style={{ textAlign: "center", color: "#FFF", fontSize: "3rem" }}>
          TOT NATURA
        </h1>

        <div style={{ margin: "60px auto", maxWidth: "1200px" }}>
          <PropertyCard
            title={property.title}
            subtitle={property.subtitle}
            description={property.description}
            images={property.images}
            link={property.link}
          />
        </div>
      </div>
    </DefaultLayout>
  );
};

export default ViuLaNatura;
